import React, { useState } from 'react';

export default function FuelStorageInspectionFormModal() {
  const [isOpen, setIsOpen] = useState(false);
  const [issues, setIssues] = useState([{ issue: '', action: '', person: '', date: '' }]);

  const addIssue = () => setIssues([...issues, { issue: '', action: '', person: '', date: '' }]);
  const deleteIssue = index => setIssues(issues.filter((_, i) => i !== index));
  const updateIssue = (index, field, value) => {
    const updated = [...issues];
    updated[index][field] = value;
    setIssues(updated);
  };

  const generalInfo = [
    'Tank Location',
    'Tank ID / Number',
    'Fuel Type',
    'Inspection Date',
    'Time',
    'Inspected By',
    'Sign',
    'Position/Title',
  ];

  const checklistSections = [
    {
      title: 'TANK EXTERIOR & STRUCTURE',
      items: [
        'Tank clearly labeled with fuel type and hazard signs',
        'No visible leaks, drips, or corrosion',
        'Tank surface (paint/coating) in good condition',
        'Tank foundation secure and stable',
        'Access ladders, railings, and platforms in safe condition',
        'Tank vents unobstructed and functional',
        'Security measures in place (locks, fencing, CCTV)',
      ],
    },
    {
      title: 'PIPING & CONNECTIONS',
      items: [
        'Pipes and hoses intact (no cracks, kinks, or leaks)',
        'Valves are functional',
        'Fuel transfer pumps in working order',
        'Spill containment tray/bund area clean and dry',
        'All fittings tight and properly sealed',
      ],
    },
    {
      title: 'SAFETY & ENVIRONMENTAL CONTROLS',
      items: [
        'Emergency shutoff switch accessible and labeled',
        'Fire extinguisher nearby and inspected',
        'Spill kit available and stocked',
        'Adequate ventilation around storage area',
        'No signs of soil contamination near tank',
      ],
    },
    {
      title: 'FUEL QUALITY & LEVEL CHECK',
      items: [
        'Fuel level within safe operating range',
        'No signs of water or sediment contamination',
        'Manual/automated gauge working properly',
        'Inspection records and fuel delivery logs up to date',
      ],
    },
  ];

  const signOffFields = ['Inspector Name', 'Signature', 'Date', 'Supervisor Review Date'];

  return (
    <div className="max-w-6xl mx-auto p-6 bg-gray-100 min-h-screen text-center">
      <h1 className="text-3xl font-bold text-gray-800">Fuel Storage Tank</h1>
      <div className="flex justify-end mb-8">
        <button
          onClick={() => setIsOpen(true)}
          className="px-4 py-2 bg-primary text-tertiary rounded shadow hover:bg-indigo-700"
        >
          + Fuel Storage Inspection Form
        </button>
      </div>

      {isOpen && (
        <div className="fixed inset-0 z-50 flex items-center justify-center bg-black bg-opacity-40 backdrop-blur-sm">
          <div className="bg-white rounded-lg shadow-xl max-w-6xl w-full max-h-[90vh] overflow-y-auto relative p-6 space-y-8">
            <button
              onClick={() => setIsOpen(false)}
              className="absolute top-4 right-4 text-gray-500 hover:text-gray-700 text-xl"
            >
              &times;
            </button>

            <h1 className="text-3xl font-bold mb-6">Fuel Storage Tank Inspection Checklist</h1>

            {/* General Information */}
            <div className="mb-8">
              <h2 className="text-xl font-semibold mb-4">General Information</h2>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {generalInfo.map(field => (
                  <div key={field}>
                    <label className="block mb-1 font-medium">{field}</label>
                    <input
                      type="text"
                      className="w-full border rounded px-3 py-2 focus:outline-none focus:ring focus:border-blue-500"
                      placeholder={`Enter ${field.toLowerCase()}`}
                    />
                  </div>
                ))}
              </div>
            </div>

            {/* Checklist Sections */}
            <div className="space-y-8">
              {checklistSections.map(section => (
                <div key={section.title}>
                  <h2 className="text-xl font-semibold mb-4">{section.title}</h2>
                  <table className="w-full table-auto border border-gray-300">
                    <thead className="bg-gray-100">
                      <tr>
                        <th className="border px-4 py-2 text-left">Item</th>
                        <th className="border px-4 py-2">√ / ⤫ / N/A</th>
                        <th className="border px-4 py-2">Comments</th>
                      </tr>
                    </thead>
                    <tbody>
                      {section.items.map((item, index) => (
                        <tr key={index} className="bg-white">
                          <td className="border px-4 py-2">{item}</td>
                          <td className="border px-4 py-2">
                            <input type="text" className="w-full border rounded px-2 py-1" />
                          </td>
                          <td className="border px-4 py-2">
                            <input type="text" className="w-full border rounded px-2 py-1" />
                          </td>
                        </tr>
                      ))}
                    </tbody>
                  </table>
                </div>
              ))}
            </div>

            {/* Issues Identified / Corrective Actions */}
            <div className="mb-8">
              <h2 className="text-xl font-semibold mb-4">Issues Identified / Corrective Actions</h2>
              <table className="w-full table-auto border border-gray-300">
                <thead className="bg-gray-100">
                  <tr>
                    <th className="border px-4 py-2">Issue</th>
                    <th className="border px-4 py-2">Corrective Action</th>
                    <th className="border px-4 py-2">Responsible Person</th>
                    <th className="border px-4 py-2">Target Date</th>
                    <th className="border px-4 py-2">Delete</th>
                  </tr>
                </thead>
                <tbody>
                  {issues.map((row, index) => (
                    <tr key={index}>
                      {['issue', 'action', 'person', 'date'].map(field => (
                        <td key={field} className="border px-4 py-2">
                          <input
                            type="text"
                            value={row[field]}
                            onChange={e => updateIssue(index, field, e.target.value)}
                            className="w-full border rounded px-2 py-1"
                          />
                        </td>
                      ))}
                      <td className="border px-4 py-2 text-center">
                        <button onClick={() => deleteIssue(index)} className="text-red-500">🗑️</button>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
              <button onClick={addIssue} className="mt-4 px-4 py-2 bg-blue-600 text-white rounded">
                + Add Issue
              </button>
            </div>

            {/* Sign-Off Section */}
            <div className="mb-8">
              <h2 className="text-xl font-semibold mb-4">Sign-Off</h2>
              <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
                {signOffFields.map(field => (
                  <div key={field}>
                    <label className="block mb-1 font-medium">{field}</label>
                    <input
                      type="text"
                      className="w-full border rounded px-3 py-2 focus:outline-none focus:ring focus:border-blue-500"
                      placeholder={`Enter ${field.toLowerCase()}`}
                    />
                  </div>
                ))}
              </div>
            </div>

            {/* Navigation Buttons */}
            <div className="flex justify-between">
              <button className="bg-gray-300 px-6 py-2 rounded">Previous</button>
              <button
                onClick={() => {
                  setIsOpen(false);
                  alert('Form submitted!');
                }}
                className="bg-green-600 text-white px-6 py-2 rounded"
              >
                Submit Inspection
              </button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
